import React from "react";
import { Route, Routes } from "react-router-dom";
import Home from "./Home";
import 'bootstrap/dist/css/bootstrap.min.css'

function App(){
    return (
        <div>
            <Routes>
                <Route path="/home" element={<Home/>} />
            </Routes>
        </div>
    )
}

export default App;
